import { boardStyles } from "../boardStyles";

function Column({ title, children }) {
  return (
    <div style={boardStyles.column.container}>
      <h1 style={boardStyles.column.header}>{title}</h1>
      <span style={{ display: "flex", justifyContent:"center" }}>
        <div style={boardStyles.column.dragPoint}>|||</div>
        <button style={boardStyles.column.edit}></button>
        <button style={boardStyles.column.newCard}></button>
      </span>

      <div style={boardStyles.column.cardContainer}>{children}</div>
    </div>
  );
}

export default Column;
